import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext"; // if you have it

export default function Login() {
  const navigate = useNavigate();
  const { login, loading } = useAuth?.() || {};
  const [error, setError] = useState("");
  const [form, setForm] = useState({ email: "", password: "", remember: false });

  const onChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm((f) => ({ ...f, [name]: type === "checkbox" ? checked : value }));
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    setError("");

    try {
      if (login) {
        // AuthContext path
        const token = await login({ email: form.email, password: form.password });
        if (form.remember && token) localStorage.setItem("token", token);
      } else {
        // Fallback direct API call
        const res = await fetch("http://localhost:5000/api/auth/login", {
          method: "POST",
          headers: { "Content-Type": "application/json" },
          body: JSON.stringify({ email: form.email, password: form.password }),
        });
        const data = await res.json();
        if (!res.ok) throw new Error(data.message || "Invalid credentials");
        if (form.remember && data.token) localStorage.setItem("token", data.token);
      }

      navigate("/auctions");
    } catch (err) {
      setError(err.message || "Login failed");
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-[#0b0b0b] to-[#121212] text-white flex items-center justify-center px-4">
      <div className="w-full max-w-md">
        <div className="mb-6 text-center">
          <div className="mx-auto h-12 w-12 rounded-full bg-gradient-to-br from-yellow-400 to-purple-600 flex items-center justify-center shadow-lg shadow-yellow-500/20">
            <span className="font-bold">⚡</span>
          </div>
          <h1 className="mt-4 text-3xl font-extrabold tracking-tight">Welcome back</h1>
          <p className="mt-2 text-gray-400">Sign in to continue winning deals</p>
        </div>

        <form onSubmit={onSubmit} className="card bg-gray-900/60 border border-yellow-500/20 rounded-xl p-6 space-y-4">
          {error ? <p className="text-red-400 text-sm">{error}</p> : null}

          <div>
            <label className="block text-sm mb-1 text-gray-300">Email address</label>
            <input
              className="input-primary w-full"
              type="email"
              name="email"
              value={form.email}
              onChange={onChange}
              placeholder="you@example.com"
              required
            />
          </div>

          <div>
            <label className="block text-sm mb-1 text-gray-300">Password</label>
            <input
              className="input-primary w-full"
              type="password"
              name="password"
              value={form.password}
              onChange={onChange}
              placeholder="••••••••"
              required
            />
          </div>

          <div className="flex items-center justify-between">
            <label className="inline-flex items-center gap-2 text-sm text-gray-300">
              <input
                type="checkbox"
                name="remember"
                checked={form.remember}
                onChange={onChange}
                className="rounded border-gray-600 bg-transparent"
              />
              Remember me
            </label>
            <Link to="#" className="text-sm text-yellow-400 hover:text-yellow-300">
              Forgot password?
            </Link>
          </div>

          <button
            type="submit"
            disabled={loading}
            className="w-full btn-ghost bg-gradient-to-r from-purple-600 to-yellow-500 hover:opacity-95 rounded-lg py-3 font-semibold"
          >
            {loading ? "Signing in..." : "Sign in"}
          </button>

          <p className="text-sm text-gray-400 text-center">
            Don’t have an account?{" "}
            <Link to="/register" className="text-yellow-400 hover:text-yellow-300 underline">
              Sign up for free
            </Link>
          </p>
        </form>
      </div>
    </div>
  );
}
